import { useState } from "react";
import {
    TextField,
    RadioGroup,
    FormControlLabel,
    Radio,
    FormControl,
    FormLabel,
} from "@mui/material";

import "./CreateTxn.scss";

function CreateTxn() {
    return (
        <div className="create-main">
            <h1>Create a new transaction here.</h1>
            <form className="create-form">
                <TextField variant="standard" label="Amount" />
                <TextField variant="standard" label="Location" />
                <RadioGroup row defaultValue="spent">
                    <FormControlLabel
                        value="spent"
                        label="Spent Money"
                        control={<Radio />}
                    />
                    <FormControlLabel
                        value="gained"
                        label="Received Money"
                        control={<Radio />}
                    />
                </RadioGroup>
                {/* <FormControl> */}
                <RadioGroup
                    row
                    // aria-labelledby="demo-row-radio-buttons-group-label"
                    // name="row-radio-buttons-group"
                    defaultValue="female"
                >
                    <FormControlLabel
                        value="female"
                        control={<Radio />}
                        label="Female"
                    />
                    <FormControlLabel
                        value="male"
                        control={<Radio />}
                        label="Male"
                    />
                    <FormControlLabel
                        value="other"
                        control={<Radio />}
                        label="Other"
                    />
                    <FormControlLabel
                        value="disabled"
                        disabled
                        control={<Radio />}
                        label="other"
                    />
                </RadioGroup>
                {/* </FormControl> */}
            </form>
        </div>
    );
}

export default CreateTxn;
